// profileSlice.js
import { createSlice, createAsyncThunk } from '@reduxjs/toolkit';
import axios from 'axios';
import { BASE_URL } from '../../config';

// Async thunk to fetch profile data
export const fetchProfile = createAsyncThunk(
  'profile/fetchProfile',
  async ({ userId, token }, { rejectWithValue }) => {
    try {
      const response = await axios.get(`${BASE_URL}/api/users/profile/${userId}/`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      return response.data;
    } catch (error) {
      if (error.response.status === 401) {
        // Handle unauthorized error
        return rejectWithValue('Session expired. Please log in again.');
      }
      return rejectWithValue(error.response?.data?.detail || 'Failed to fetch profile.');
    }
  }
);

// Async thunk to fetch posts
export const fetchPosts = createAsyncThunk(
  'profile/fetchPosts',
  async ({ userId, token }, { rejectWithValue }) => {
    try {
      const response = await axios.get(`${BASE_URL}/api/posts/?user_id=${userId}`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      return response.data;
    } catch (error) {
      return rejectWithValue('Failed to fetch posts.');
    }
  }
);

// Async thunk to fetch bookmarks
export const fetchBookmarks = createAsyncThunk(
  'profile/fetchBookmarks',
  async (token, { rejectWithValue }) => {
    try {
      const response = await axios.get(`${BASE_URL}/api/bookmarks`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      return response.data.map((bookmark) => bookmark.post);
    } catch (error) {
      return rejectWithValue('Failed to fetch bookmarks.');
    }
  }
);

// Slice
const profileSlice = createSlice({
  name: 'profile',
  initialState: {
    profile: null,
    posts: [],
    bookmarks: [],
    likedPosts: {},
    comments: {},
    loading: false,
    error: null,
    modalIsOpen: false,
    modalImage: '',
    openCommentId: null,
    imageType: '',
    newComment: "",
    replyingToCommentId: null,
    commentText: '',
    followerCount: 0,
    followingCount: 0,
    bookmarkPosts: {},
    showEmojiPicker: false,
  },
  reducers: {
    setModalIsOpen(state, action) {
      state.modalIsOpen = action.payload;
    },
    setModalImage(state, action) {
      state.modalImage = action.payload;
    },
    setOpenCommentId(state, action) {
      state.openCommentId = action.payload;
    },
    setImageType(state, action) {
      state.imageType = action.payload;
    },
    setNewComment(state, action) {
      state.newComment = action.payload;
    },
    setReplyingToCommentId(state, action) {
      state.replyingToCommentId = action.payload;
    },
    setCommentText(state, action) {
      state.commentText = action.payload;
    },
    setShowEmojiPicker(state, action) {
      state.showEmojiPicker = action.payload;
    },
    setFollowerCount(state, action) {
      state.followerCount = action.payload;
    },
    setFollowingCount(state, action) {
      state.followingCount = action.payload;
    },
    setBookmarkPosts(state, action) {
      state.bookmarkPosts = action.payload;
    },
    setError(state, action) {
      state.error = action.payload;
    },
    setLoading(state, action) {
      state.loading = action.payload;
    },
    setProfile(state, action) {
      state.profile = action.payload;
    },
    setPosts(state, action) {
      state.posts = action.payload;
    },
    setLikedPosts(state, action) {
      state.likedPosts = action.payload;
    },
    setComments(state, action) {
      state.comments = action.payload;
    },
  },
  extraReducers: (builder) => {
    builder
      .addCase(fetchProfile.pending, (state) => {
        state.loading = true;
      })
      .addCase(fetchProfile.fulfilled, (state, action) => {
        state.profile = action.payload;
        state.loading = false;
      })
      .addCase(fetchProfile.rejected, (state, action) => {
        state.error = action.payload;
        state.loading = false;
      })
      .addCase(fetchPosts.pending, (state) => {
        state.loading = true;
      })
      .addCase(fetchPosts.fulfilled, (state, action) => {
        state.posts = action.payload;
        state.loading = false;
      })
      .addCase(fetchPosts.rejected, (state, action) => {
        state.error = action.payload;
        state .loading = false;
      })
      .addCase(fetchBookmarks.pending, (state) => {
        state.loading = true;
      })
      .addCase(fetchBookmarks.fulfilled, (state, action) => {
        state.bookmarks = action.payload;
        state.loading = false;
      })
      .addCase(fetchBookmarks.rejected, (state, action) => {
        state.error = action.payload;
        state.loading = false;
      });
  },
});

export const {
  setModalIsOpen,
  setModalImage,
  setOpenCommentId,
  setImageType,
  setNewComment,
  setReplyingToCommentId,
  setCommentText,
  setShowEmojiPicker,
  setFollowerCount,
  setFollowingCount,
  setBookmarkPosts,
  setError,
  setLoading,
  setProfile,
  setPosts,
  setLikedPosts,
  setComments,
} = profileSlice.actions;

export default profileSlice.reducer;
